import streamlit as st
from htbuilder import HtmlElement, div, hr, a, p, img, styles
from htbuilder.units import percent, px
from PIL import Image
import Startscherm,DoelVanHetProject,FeaturesPermAI,WorkflowVoorML,Login


def image(src_as_string, **style):
    return img(src=src_as_string, style=styles(**style))

def link(link, text, **style):
    return a(_href=link, _target="_blank", style=styles(**style))(text)

def layout(*args):

    style = """
    <style>
      # MainMenu {visibility: hidden;}
      footer {visibility: hidden;}
     .stApp { bottom: 65px; }
    </style>
    """
    


    style_div = styles(
        position="fixed",
        left=0,
        bottom=0,
        margin=px(0, 0, -10, 0),
        width=percent(100),
        color="black",
        text_align="left",
        height="bottom",
        opacity=1
    )

    style_hr = styles(
        display="block",
        margin=px(1, 1, 5, 1),
        border_style="inset",
        border_width=px(0.5)
    )

    body = p()
    foot = div(
        style=style_div
    )(
        hr(
            style=style_hr
        ),
        body
    )

    st.markdown(style, unsafe_allow_html=True)

    for arg in args:
        if isinstance(arg, str):
            body(arg)

        elif isinstance(arg, HtmlElement):
            body(arg)

    st.markdown(str(foot), unsafe_allow_html=True)
from st_clickable_images import clickable_images
import base64
def centerImage(pathImage,width,underscript):
    images = []
    
    with open(pathImage, "rb") as image:
            encoded = base64.b64encode(image.read()).decode()
            images.append(f"data:image/jpeg;base64,{encoded}")
    clicked = clickable_images(
                images,
                div_style={"display": "flex", "justify-content": "bottom", "flex-wrap": "wrap"},
                img_style={'width':f'{width}'},
            )
    if underscript!='':
        st.markdown(f"<p style='text-align: center; color: grey;'>{underscript}</p>", unsafe_allow_html=True)

def footer():
    myargs = [

        image("data:image/png;base64,",
               height=px(70), marginLeft= "10px"),


        
    ]
    layout(*myargs)

